            //System.out.println("Current time: " +System.currentTimeMillis());


            if(classEnded != 0 && System.currentTimeMillis() - classEnded >= TENMIN)
            {
              //System.out.println("EXIT");
            	return;	              
        	}

            sleep(500);
        }
        newCurrentTime = 0;
        ic.facade.setMenuDataRec(false);
        dataReceived = false;

       // db.disconnect();
	}
